#include <iostream>

/*TABLICE DWUWYMIAROWE

Tablica dwuwymiarowa to tablica, w której każdy element posiada numer wiersza i numer kolumny
np.
int tablica[5][3]; // deklaracja tablicy o pięciu wierszach i trzech kolumnach

*/

const int W{ 4 };
const int K{ 6 };

#define NEW_LINE std::cout << std::endl

void wypiszTablice2W(int tab[][K]) {		// podając tablicę jako argument do funkcji, przynajmniej ostatni indeks musi określać wielkość tablicy (liczbę kolumn)
	for (int i{}; i < W; ++i) {
		for (int j{}; j < K; ++j) {
			std::cout << tab[i][j] << '\t';
		}
		NEW_LINE;
	}
}

int main() {
	int tablica2w[W][K];
	// uzupełnienie tablicy:
	for (int i{}; i < W; ++i) {
		for (int j{}; j < K; ++j) {
			tablica2w[i][j] = i * j;
		}
	}
	// wypisanie tablicy:
	for (int i{}; i < W; ++i) {
		for (int j{}; j < K; ++j) {
			std::cout << tablica2w[i][j] << '\t';
		}
		NEW_LINE;
	}
	NEW_LINE;
	wypiszTablice2W(tablica2w);
	NEW_LINE;

	// wypisanie tylko trzeciej kolumny:
	for (int i{}; i < W; ++i) {
		std::cout << tablica2w[i][2] << '\t';
	}
	NEW_LINE;
	NEW_LINE;

	// wszystkie elementy w drugim wierszu zostaną zwiększone o 5:
	for (int i{}; i < K; ++i) {
		tablica2w[1][i] += 5;
	}

	// wypisanie na ekran po zmianie:
	wypiszTablice2W(tablica2w);

	return 0;
}

#include <iostream>
#include <ctime>

using namespace std;

const int ROZMIAR{ 6 };

void sortuj(int tab[]) {
	for (auto i{ 0 }; i < ROZMIAR - 1; ++i) {
		for (auto j{ 0 }; j < ROZMIAR - i - 1; ++j) {
			if (tab[j] > tab[j + 1]) {
				std::swap(tab[j], tab[j + 1]);
			}
		}
	}
}

bool czyJuzJest(int liczba, const int tablica[], int n) {
	for (auto i{ 0 }; i < n; ++i) {
		if (tablica[i] == liczba) {
			return true;
		}
	}
	return false;
}

void wypelni(int tab[]) {
	for (int i = 0; i < ROZMIAR; ++i) {
		int losowa;
		do {
			losowa = rand() % 49 + 1;
		} while (czyJuzJest(losowa, tab, i));
		tab[i] = losowa;
	}
	sortuj(tab);
}

void wyswietl(int tab[]) {
	for (int i = 0; i < ROZMIAR; ++i) {
		cout << tab[i] << ' ';
	}
	cout << endl;
}

void podaj_liczby(int tab[]) {
	for (int i{}; i < ROZMIAR; ++i) {
		std::cout << "Podaj liczbe nr " << i + 1 << ": ";
		int liczba;
		bool blad;
		do {
			std::cin >> liczba;
			blad = false;
			if (liczba < 1 || liczba > 49) {
				std::cout << "Liczba musi sie zawierac w przedziale od 1 do 49. Wpisz jeszcze raz: ";
				blad = true;
			}
			else if (czyJuzJest(liczba, tab, i)) {
				std::cout << "Juz wczesniej podales te liczbe, wpisz inna: ";
				blad = true;
			}
		} while (blad);
		tab[i] = liczba;
	}
	sortuj(tab);
}

int ileTrafionych(const int tab1[], const int tab2[]) {
	int wynik{};
	for (int i{}; i < ROZMIAR; ++i) {
		if (czyJuzJest(tab1[i], tab2, ROZMIAR)) {
			++wynik;
		}
	}
	return wynik;
}

int main() {
	int tab_user[ROZMIAR];
	podaj_liczby(tab_user);
	system("cls");
	std::cout << "Podane przez Ciebie liczby: ";
	wyswietl(tab_user);
	int tab[ROZMIAR];
	srand(time(nullptr));
	wypelni(tab);
	std::cout << "Wylosowane liczby: ";
	wyswietl(tab);
	std::cout << "Udalo Ci sie trafic " << ileTrafionych(tab_user, tab) << " liczb\n";
	return 0;
}

